import React from 'react';
import classes from './Portfolio.module.css';
import { Container, Row, Col } from 'react-bootstrap';

const portfolio = (props) => {
  return(
  <Container>
    <div className={classes.Portfolio}>
      <h1>PORTFOLIO</h1>
    </div>
  </Container>
  )
}

export default portfolio;
